import "./wrapped.css"
import Right from "../components/rightbtn";
import Left from "../components/leftbtn";
import { useEffect, } from "react";
function Six(props){
    const arr=[
        {num:1,name:props.langone},
        {num:2,name:props.langtwo},
        {num:3,name:props.langthree},
        {num:4,name:props.langfour},
        {num:5,name:props.langfive},
        ]
    // useEffect(() => {
    //     setTimeout(() => {
    //       window.location.href="/wrapped/7"
    //     }, 30000)
    //   }, [])
    return(
        <>
        <div className="six">
        <Left path="#slide5"></Left>
            <Right path="#slide1"></Right>
            <center>
                {/* first text starts */}
            <h2 className="text-5xl one-text">2023 Wrapped<br></br>Coding</h2>
            {/* first text ends */}
            <h2 className="text-5xl two-text">Hello {props.name}<br></br>Its Wrapped Time Ready?Lets do This!</h2>
            </center>
       
        </div>
        
        </>
    )
}
export default Six;
